import React from 'react';
import {FaGoogle} from "react-icons/fa";


const SignInButtonLarge = (props) => {
    return(
        <div className={'signInButtonLarge'}>
                <FaGoogle className='signInButtonLarge-logo' />
                <p className={'signInButtonLarge-text'}>Sign In</p>
        </div>
    );
};

export default SignInButtonLarge;
